import React, { useState, useEffect } from 'react';

function HomePage() {
  const [username, setUsername] = useState(formData.username);

  useEffect(() => {
    // Retrieve username from browser storage
    const storedUsername = localStorage.getItem('formData.username');
    console.log('Stored username:', storedUsername); // Debugging statement
    if (storedUsername) {
      setUsername(storedUsername);
    }
  }, []);

  console.log('Username state:', username); // Debugging statement

  return (
    <div>
      <header>
        <h1>Home HomePage</h1>
      </header>
      <main>
        <div>
          <h2>Profile Section</h2>
          {username ? (
            <p>Welcome, {username}!</p>
          ) : (
            <p>No profile data available</p>
          )}
        </div>
      </main>
    </div>
  );
}

export default HomePage;
